import React from 'react';

class Head extends React.Component{
  render (){
      
    return (
        <>
            <h6>
                <h7>About</h7>
                &nbsp;&nbsp;&nbsp;
                <h7>Experience</h7>
                &nbsp;&nbsp;&nbsp;
                <h7>Work</h7>
                &nbsp;&nbsp;&nbsp;
                <h7>Contact</h7>
                &nbsp;&nbsp;&nbsp;
                <h7>Blogs</h7>
                &nbsp;&nbsp;&nbsp;
                <h8> 
                    Resume
                </h8>
            </h6>
            
            {/* <h6>
            <h7>
            Portfolio
            </h7>
            &nbsp
            <h7>
            Portfolio
            </h7>
            </h6> */}
        </>
    );
  }
}

export default Head;
